import React from 'react';

const WindowScoreBoard = (data) => {
    const instance = data.props;
    console.log(instance);
    return (
        <div className="window-score-board">
            <table>
                <thead>
                    <th>Team</th>
                    <th>FT Out</th>
                    <th>ST Out</th>
                    <th>Technical Fouls</th>
                </thead>
                <tbody>
                    {/* Home */}
                    <tr>
                        <td>{instance.hls.ta}</td>
                        <td>{instance.hls.ftout}}</td>
                        <td>One</td>
                        <td>One</td>
                    </tr>
                    {/* Away */}
                    <tr>
                        <td>{instance.vls.ta}</td>
                        <td>One</td>
                        <td>One</td>
                        <td>One</td>
                    </tr>
                </tbody>
            </table>

        </div>
    );
}

export default WindowScoreBoard;
